(61, 12, 'Indigo', 'Blue', 'Blue Cracker', 'Found this beautiful blue cracker on the north first street on 14 December 2021. Research has shown that cracker butterflies can detect the sounds made by other butterflies, which would be a form of social communication-SO COOL!', 'uploads/1639525115.2621_bluecracker.jpeg', '2021-12-14 16:18:02'),
(62, 12, 'Aquaria', 'Blue', 'Giant Blue Morpho', 'The blue Morpho is among the largest butterflies in the world, with wings spanning from five to eight inches. Their vivid, iridescent blue colouring is a result of the microscopic scales on the backs of their wings, which reflect light. The underside of the Morpho’s wings, on the other hand, is a dull brown colour with many eyespots, providing camouflage against predators such as birds and insects when its wings are closed. ', 'uploads/1639525078.207_butterfly-1.jpg', '2021-12-14 16:24:31'),
(63, 12, 'Prosure', 'Red', 'Great Mormon', 'Looking at its tail and yellow colour on sides of its abdomen, I think this one\'s a female great mormon. These are pretty common in my area and today I say a bunch of them fluttering their way across the woods. Always a sight!', 'uploads/1639529368.7815_2975007546_97486c91b9_b.jpeg', '2021-12-14 16:47:05'),
(64, 12, 'Plasmosis', 'Yellow', 'Emperor swallowtail', 'Found this little one during my trip to New York in our backyard. It is one of the most familiar butterflies in the eastern United States,where it is common in many different habitats and travels as far North as Winnipeg Manitoba, Canada. Sooooo pretty!', 'uploads/1639529888.6144_Nectoring.jpeg', '2021-11-24 16:52:38'),
(65, 12, 'Junonia', 'Blue', 'Blue Pansy', 'The adult blue Pansys have an interesting behaviour. They occur in open areas, often sitting on bare ground. It has a stiff flap and glide style of flight and maintains a territory, driving away other butterflies that enter it.This little guy had bright yellow spots on both the wings that looked like eyes!', 'uploads/1639531774.6201_large.jpeg', '2021-08-12 17:09:40'),
(66, 12, 'Elita', 'Yellow', 'Orange Emigrant', 'Elita here was 2.5 inches long and I\'ve never seen a prettier yellow than this! This was a male emigrant with white forewings edged in black, and cadmium-yellow hindwings, with black spots on the margins.', 'uploads/1639531789.548_OE_adult_Federick_Ho_01.jpeg', '2021-12-02 11:25:23');
